import React from "react";

import "./NavBarCard.css";

const NavBarCard = () => {
  const homeImg = "../assets/Home.svg";
  const searchImg = "../assets/search.svg";
  const items = () => [
    { title: "home", img: homeImg },
    { title: "search", img: searchImg },
  ];

  const classes = "navbar";
  return <div className={classes}>{items.title}</div>;
};

export default NavBarCard;
